import React, { useState } from "react";
import { auth, provider, signInWithPopup, signOut } from "../firebase";
import { useNavigate } from "react-router-dom";
import lgs from "../assets/lgs.jpg";

const GoogleLogin = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  // List of example hospitals in Palnadu
  const hospitals = [
    "Guntur General Hospital",
    "Palnadu Super Specialty Hospital",
    "NRI Medical College",
    "Kamineni Hospitals",
    "Sai Priya Hospital",
    "Sri Sai Hospital",
    "Life Care Hospital"
  ];

  const signInWithGoogle = async () => {
    try {
      const result = await signInWithPopup(auth, provider);
      setUser(result.user);
      alert(`Welcome ${result.user.displayName}`);
    } catch (error) {
      console.error("Google Sign-In Error:", error.message);
    }
  };

  const handleLogout = async () => {
    try {
      await signOut(auth);
      setUser(null);
      alert("Logged out successfully!");
    } catch (error) {
      console.error("Logout Error:", error.message);
    }
  };

  return (
    <div style={styles.mainContainer}>
      {/* Header Section - Logo, Title, Sign-In */}
      <div style={styles.header}>
        <img src={lgs} alt="Logo" style={styles.logo} />
        <p style={styles.title}>Happy Doctors Consultancy</p>
        
        {/* Hospitals List */}
        <div style={styles.hospitalsContainer}>
          <h4 style={styles.hospitalsTitle}>Hospitals in Palnadu tied with us:</h4>
          <ul style={styles.hospitalsList}>
            {hospitals.slice(0, 3).map((hospital, index) => (
              <li key={index} style={styles.hospitalItem}>{hospital}</li>
            ))}
          </ul>
        </div>
        
        {!user && (
          <button onClick={signInWithGoogle} style={styles.button}>
            Sign in with Google
          </button>
        )}
      </div>

      {/* User Profile Section */}
      {user && (
        <div style={styles.profileContainer}>
          <div style={styles.profile}>
            <img src={user.photoURL} alt="Profile" style={styles.avatar} />
            <h3>{user.displayName}</h3>
            <p>{user.email}</p>
            <div style={styles.buttonGroup}>
              <button onClick={() => navigate("/healthcard")} style={styles.cardButton}>
                Happy Doctors Card
              </button>
              <button onClick={handleLogout} style={styles.button}>Logout</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

// CSS Styles
const styles = {
  mainContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    width: "100%",
    padding: "20px",
  },

  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    width: "100%",
    maxWidth: "100%",
    padding: "10px 130px ",
    backgroundColor: "#f8f9fa",
    borderRadius: "10px",
    boxShadow: "0 2px 5px rgba(0, 0, 0, 0.1)",
  },

  logo: {
    width: "80px",
    height: "auto",
  },

  title: {
    fontSize: "35px",
    fontWeight: "bold",
    flexGrow: 1,
    textAlign: "center",
  },

  hospitalsContainer: {
    marginRight: "20px",
    padding: "10px",
    backgroundColor: "#f0f0f0",
    borderRadius: "5px",
  },

  hospitalsTitle: {
    margin: "0 0 5px 0",
    fontSize: "14px",
    color: "#555",
  },

  hospitalsList: {
    listStyleType: "none",
    padding: 0,
    margin: 0,
    fontSize: "12px",
  },

  hospitalItem: {
    padding: "2px 0",
    whiteSpace: "nowrap",
  },

  button: {
    backgroundColor: "#4285F4",
    color: "white",
    padding: "10px 20px",
    fontSize: "16px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    whiteSpace: "nowrap",
  },

  profileContainer: {
    width: "100%",
    textAlign: "center",
    marginTop: "20px",
  },

  profile: {
    padding: "20px",
    border: "1px solid #ccc",
    borderRadius: "10px",
    display: "inline-block",
    maxWidth: "90%",
  },

  avatar: {
    width: "80px",
    borderRadius: "50%",
  },

  buttonGroup: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    marginTop: "10px",
  },

  cardButton: {
    backgroundColor: "green",
    color: "white",
    padding: "10px 20px",
    fontSize: "16px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },

  "@media (max-width: 768px)": {
    header: {
      flexDirection: "column",
      alignItems: "center",
      textAlign: "center",
    },

    title: {
      fontSize: "18px",
    },

    hospitalsContainer: {
      margin: "10px 0",
      textAlign: "center",
    },

    button: {
      marginTop: "10px",
      fontSize: "14px",
      padding: "8px 16px",
    },
  },
};

export default GoogleLogin;
